                    return (
                        <li><a href={'#' +item }> {item} </a></li>
                    )
                });
        return (
            <nav>
                <h2 className="title"> { this.props.title } </h2>
                <ul>
                    <li> <a href="#"> Home </a> </li>
                    <li> <a href="#">Menu </a></li>
                    <li> <a href="#">About </a> </li>
                    <li> <a href="#"> Contact us</a> </li>
                </ul>

            </nav>
        );
    }

}

